import React, { useState, useEffect } from "react";
import axios from "axios";

const API_BASE = "http://localhost:5144";

const getToken = () => localStorage.getItem("token");

const getConfig = () => ({
  headers: { Authorization: `Bearer ${getToken()}` },
});

export default function AdminPanel() {
  const [currentAdmin, setCurrentAdmin] = useState(null);
  const [admins, setAdmins] = useState([]);
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState("");

  // Fetch profile & admins on mount
  useEffect(() => {
    const token = getToken();
    if (token) {
      fetchProfile();
      fetchAdmins();
    }
  }, []);

  const fetchProfile = async () => {
    setLoading(true);
    try {
      const email = localStorage.getItem("email");
      if (!email) {
        setLoading(false);
        return;
      }
      const res = await axios.get(
        `${API_BASE}/Admin/Profile?email=${encodeURIComponent(email)}`,
        getConfig()
      );
      setCurrentAdmin(res.data);
    } catch (err) {
      console.error("Error fetching profile:", err);
      setCurrentAdmin(null);
    } finally {
      setLoading(false);
    }
  };

  const fetchAdmins = async () => {
    try {
      const res = await axios.get(`${API_BASE}/Admin/ListofAdmins`, getConfig());
      setAdmins(res.data);
    } catch (err) {
      console.error("Error fetching admins:", err);
      setAdmins([]);
    }
  };

  const handleEdit = (admin) => {
    alert(`Edit clicked for ${admin.Name} (id: ${admin.AdminId})`);
    // You can implement form population here
  };

  const handleDelete = (adminId) => {
    alert(`Delete clicked for AdminId: ${adminId}`);
    // You can implement delete logic here
  };

  if (loading) return <p>Loading profile...</p>;

  if (!currentAdmin) {
    return <p>Please login to view admins.</p>;
  }

  return (
    <div style={{ maxWidth: 800, margin: "auto", padding: 20 }}>
      <h2>
        Welcome, {currentAdmin.Name} (Role: {currentAdmin.Role})
      </h2>

      <h3>Admin List</h3>
      <table
        border="1"
        cellPadding="8"
        style={{ width: "100%", borderCollapse: "collapse" }}
      >
        <thead>
          <tr>
            <th>Name</th>
            <th>Email</th>
            <th>Role</th>
            <th>Permissions</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {admins.length === 0 && (
            <tr>
              <td colSpan="5" style={{ textAlign: "center" }}>
                No admins found
              </td>
            </tr>
          )}
          {admins.map((admin) => (
            <tr key={admin.AdminId}>
              <td>{admin.Name}</td>
              <td>{admin.Email}</td>
              <td>{admin.Role}</td>
              <td>{admin.Permissions}</td>
              <td>
                <button onClick={() => handleEdit(admin)} style={{ marginRight: 8 }}>
                  Edit
                </button>
                <button onClick={() => handleDelete(admin.AdminId)} style={{ color: "red" }}>
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {message && <p>{message}</p>}
    </div>
  );
}
